-- ----------------------------
-- Table structure for account_log
-- ----------------------------
DROP TABLE IF EXISTS `account_log`;
CREATE TABLE `account_log`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '门店ID',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商户ID',
  `member_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员ID',
  `before_change_amount` decimal(11, 0) NOT NULL DEFAULT 0 COMMENT '变动前金额（分）',
  `after_change_amount` decimal(11, 0) NOT NULL DEFAULT 0 COMMENT '变动后金额(分）',
  `amount` decimal(11, 0) NOT NULL DEFAULT 0 COMMENT '变动金额(分）',
  `change_type` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '资金变动类型：1充值，2=充值退款，3订单消费，4订单退款，5转账，6手动调整',
  `desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `fee` decimal(5, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '按照千分点计算',
  `fee_amount` decimal(8, 0) UNSIGNED NOT NULL DEFAULT 0,
  `source_member_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '转账涞源ID',
  `order_sn` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '来源单号',
  `from_ip` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `transaction_sn` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '流水号',
  `account_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '账号类型：1预存款',
  `sys_uid` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '',
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `update_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_order_sn`(`order_sn`) USING BTREE,
  INDEX `idx_transaction_sn`(`transaction_sn`) USING BTREE,
  INDEX `idx_uid`(`merchant_id`) USING BTREE,
  INDEX `idx_store_id`(`store_id`) USING BTREE,
  INDEX `idx_merchant_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 748 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '账户流水' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of account_log
-- ----------------------------

