  `oauth_openid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `type` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0=微信',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_appid`(`appid`) USING BTREE,
  INDEX `idx_openid`(`openid`) USING BTREE,
  INDEX `idx_oauth_openid`(`oauth_openid`) USING BTREE,
  INDEX `idx_appid_openid`(`appid`, `openid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '粉丝表' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for open_platform_config
-- ----------------------------
DROP TABLE IF EXISTS `open_platform_config`;
CREATE TABLE `open_platform_config`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `business_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `restaurant_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `type` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1=款易',
  `config` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '序列化配置参数',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  `is_order_push` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1=推送，0=不推送',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unindex`(`restaurant_id`, `type`) USING BTREE,
  INDEX `idx_business_id`(`business_id`) USING BTREE,
  INDEX `idex_restaurant_id`(`restaurant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '开发平台配置' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of open_platform_config
-- ----------------------------

-- ----------------------------
-- Table structure for open_platform_order_ext
-- ----------------------------
DROP TABLE IF EXISTS `open_platform_order_ext`;
CREATE TABLE `open_platform_order_ext`  (
  `id` int(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `platform` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0=款易',
  `order_sn` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `out_order_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '外部订单号',
  `refund_status` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款状态：0=》未退款，1=》已申请',
  `refund_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `result` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  `is_del` tinyint(2) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ind_restaurantid`(`restaurant_id`) USING BTREE,
  INDEX `ind_ordersn`(`order_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 60 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '第三方订单关联' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of open_platform_order_ext
-- ----------------------------

-- ----------------------------
-- Table structure for order_activity_log
-- ----------------------------
DROP TABLE IF EXISTS `order_activity_log`;
CREATE TABLE `order_activity_log`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单sn',
  `act_ext` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_sn`(`order_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 252 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单活动日志' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of order_activity_log
-- ----------------------------

-- ----------------------------
-- Table structure for order_or_food_discount
-- ----------------------------
DROP TABLE IF EXISTS `order_or_food_discount`;
CREATE TABLE `order_or_food_discount`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `val` decimal(10, 1) NOT NULL COMMENT '折扣值或者立减值',
  `discount_or_reduce` tinyint(1) NOT NULL DEFAULT 1 COMMENT '标识当前记录val所表示的值，1折扣，2立减，默认1折扣',
  `restaurant_id` int(11) NOT NULL COMMENT '店铺id',
  `business_id` int(11) NULL DEFAULT NULL COMMENT '代理id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3248 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of order_or_food_discount
-- ----------------------------

-- ----------------------------
-- Table structure for order_settle_picture
-- ----------------------------
DROP TABLE IF EXISTS `order_settle_picture`;
CREATE TABLE `order_settle_picture`  (
  `id` int(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '店铺ID',
  `order_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `platform` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '1=饿了么，2=百度',
  `img_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '图片路径',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '识别内容',
  `device_mac` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '第三方设备号',
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `ind_restaurantId`(`restaurant_id`) USING BTREE,
  INDEX `ind_orderSn`(`order_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 127 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单结算图片识别库' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of order_settle_picture
-- ----------------------------

-- ----------------------------
-- Table structure for order_time_set
-- ----------------------------
DROP TABLE IF EXISTS `order_time_set`;
CREATE TABLE `order_time_set`  (
  `order_timset_id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(10) NOT NULL COMMENT '店铺id',
  `types` tinyint(1) NOT NULL DEFAULT 1 COMMENT '点餐时间设定类型1准时用餐时间 2自由食用时间',
  `is_today` tinyint(1) NOT NULL COMMENT '今天开关',
  `is_tomorrow` tinyint(1) NOT NULL COMMENT '明天开关',
  `stop_ordering_time` int(10) NOT NULL COMMENT '停止点餐时间，提前分钟',
  `add_order_time` smallint(5) NULL DEFAULT NULL COMMENT '下单时间+分钟以上设置',
  `business_hours` char(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '营业时间范围',
  `is_free_today` tinyint(1) NOT NULL DEFAULT 0 COMMENT '自由食用的今天开关',
  `is_free_tomorrow` tinyint(1) NOT NULL DEFAULT 0 COMMENT '自由食用的m明天开关',
  PRIMARY KEY (`order_timset_id`) USING BTREE,
  UNIQUE INDEX `restaurant_id`(`restaurant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 40 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '点餐下单食用时间设定表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of order_time_set
-- ----------------------------

-- ----------------------------
-- Table structure for order_time_set_ext
-- ----------------------------
DROP TABLE IF EXISTS `order_time_set_ext`;
CREATE TABLE `order_time_set_ext`  (
  `order_timext_id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(10) NOT NULL COMMENT '店铺id',
  `order_timset_id` int(10) NOT NULL COMMENT '点餐下单食用时间Id',
  `is_use` tinyint(1) NOT NULL COMMENT '是否使用',
  `times` char(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '时间',
  PRIMARY KEY (`order_timext_id`) USING BTREE,
  INDEX `restaurant_id`(`restaurant_id`, `order_timset_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1875 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '下单准时用餐具体时间表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of order_time_set_ext
-- ----------------------------

-- ----------------------------
-- Table structure for orders
-- ----------------------------
DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders`  (
  `order_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `member_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '门店ID',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商户ID',
  `order_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `out_trade_no` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '外部订单号',
  `total_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付金额（分）',
  `order_status` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态：0未支付，1已支付',
  `pay_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际支付金额（分）',
  `pay_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付时间',
  `refund_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款状态：0未退款，1部分退款，2全额退款',
  `refund_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款金额（分）',
  `refund_at` int(11) UNSIGNED NOT NULL,
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `update_at` int(11) NOT NULL,
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `idx_member_id`(`member_id`) USING BTREE,
  INDEX `idx_store_id`(`store_id`) USING BTREE,
  INDEX `idx_merchant_id`(`merchant_id`) USING BTREE,
  INDEX `idx_order_sn`(`order_sn`) USING BTREE,
  INDEX `idx_out_trade_no`(`out_trade_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 501 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of orders
-- ----------------------------

-- ----------------------------
-- Table structure for ordinary_pay
-- ----------------------------
DROP TABLE IF EXISTS `ordinary_pay`;
CREATE TABLE `ordinary_pay`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `open` tinyint(2) NOT NULL DEFAULT 0 COMMENT '普通支付是否打开',
  `restaurant_id` int(11) NOT NULL COMMENT '店铺id',
  `business_id` int(11) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 260 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of ordinary_pay
-- ----------------------------

-- ----------------------------
-- Table structure for pay_config
-- ----------------------------
DROP TABLE IF EXISTS `pay_config`;
CREATE TABLE `pay_config`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `merchant_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `store_id` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `type` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1=微信',
  `config` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '序列化配置参数',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `unindex`(`merchant_id`, `type`) USING BTREE,
  INDEX `idx_merchant_id`(`merchant_id`) USING BTREE,
  INDEX `idx_store_id`(`store_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '支付配置' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of pay_config
-- ----------------------------

-- ----------------------------
-- Table structure for pay_log
-- ----------------------------
DROP TABLE IF EXISTS `pay_log`;
CREATE TABLE `pay_log`  (
  `id` int(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `order_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `pay_amount` decimal(10, 2) NOT NULL DEFAULT 0.00,
  `pay_mode` tinyint(4) UNSIGNED NOT NULL DEFAULT 0,
  `pay_status` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付状态：1=已支付，2=部分退款，3=全额退款',
  `pay_type` tinyint(2) UNSIGNED NOT NULL DEFAULT 0 COMMENT '2=微信，1=支付宝',
  `trade_num` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '微信transaction_id,支付宝trade_no',
  `create_at` int(11) NOT NULL DEFAULT 0,
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  `log` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_order_sn`(`order_sn`) USING BTREE,
  INDEX `idx_mchid_ordersn`(`merchant_id`, `order_sn`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '支付日志' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of pay_log
-- ----------------------------

-- ----------------------------
-- Table structure for pay_mode
-- ----------------------------
DROP TABLE IF EXISTS `pay_mode`;
CREATE TABLE `pay_mode`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) NOT NULL COMMENT '店铺id',
  `mode` tinyint(4) NOT NULL COMMENT '1：官方支付，2：普通支付',
  `business_id` int(11) NOT NULL,
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_merchant_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '官方支付与第四方支付开关表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of pay_mode
-- ----------------------------

-- ----------------------------
-- Table structure for pay_select
-- ----------------------------
DROP TABLE IF EXISTS `pay_select`;
CREATE TABLE `pay_select`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '方便前端页面显示',
  `value` tinyint(4) NOT NULL COMMENT '0，1 控制支付的关闭与开启',
  `img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '店铺后台某支付的图片标识',
  `restaurant_id` int(11) NOT NULL COMMENT '关联的店铺',
  `config_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'input（radio）的name值',
  `s_num` tinyint(4) NOT NULL COMMENT '1：微信支付 2：支付宝支付 3：普通微信支付 4：普通支付宝支付 5：银联或现金 6：刷脸支付123456分别代表不同的支付方式，方便判断某支付在页面是否显示',
  `business_id` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1725 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '各支付方式开关表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of pay_select
-- ----------------------------

-- ----------------------------
-- Table structure for prepaid_callback_fail
-- ----------------------------
DROP TABLE IF EXISTS `prepaid_callback_fail`;
CREATE TABLE `prepaid_callback_fail`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付成功后做回调处理时更新数据库没有更新成功的订单号',
  `problem_table` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '涉及到哪个表，prepaid_order就是更新订单状态和下单时间的问题，vip就是更新余额的问题',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '预充值回调失败记录表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of prepaid_callback_fail
-- ----------------------------

-- ----------------------------
-- Table structure for prepaid_order
-- ----------------------------
DROP TABLE IF EXISTS `prepaid_order`;
CREATE TABLE `prepaid_order`  (
  `order_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `member_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员id',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商户id 本站',
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '门店id（关联）',
  `order_sn` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `total_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '充值额（要支付的钱）单位：分',
  `order_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '订单状态，1：已支付；0：未支付',
  `relation_rule_id` int(11) NOT NULL DEFAULT 0 COMMENT '对应的预充值优惠规则id',
  `account` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '充多少送多少规则中的“充多少”',
  `benefit` decimal(10, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '充多少送多少规则中的“送多少”',
  `finall_benefit` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最终充值加优惠总共多少，如充100送30，则总共130',
  `saoma_out_trade_no` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '被扫支付，提交给官方的商户订单号',
  `pay_type` tinyint(2) NOT NULL DEFAULT 2 COMMENT '0现金，1支付宝，2微信，默认2微信',
  `pay_time` int(11) NOT NULL DEFAULT 0 COMMENT '订单支付时间',
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '订单生成时间',
  `update_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `openid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `trade_num` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `idx_order_sn`(`order_sn`) USING BTREE,
  INDEX `idx_store_id`(`store_id`) USING BTREE,
  INDEX `idx_member_id`(`member_id`) USING BTREE,
  INDEX `idx_business_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 39 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '预充值订单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of prepaid_order
-- ----------------------------

-- ----------------------------
-- Table structure for process
-- ----------------------------
DROP TABLE IF EXISTS `process`;
CREATE TABLE `process`  (
  `process_id` int(11) NOT NULL AUTO_INCREMENT,
  `process_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '流程页对应的url地址',
  `process_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '点餐流程的名称',
  `process_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '点餐流程页面缩略图',
  `sort` tinyint(4) NOT NULL COMMENT '页面排序（0-n）',
  PRIMARY KEY (`process_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '点餐流程表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of process
-- ----------------------------

-- ----------------------------
-- Table structure for public_number_set
-- ----------------------------
DROP TABLE IF EXISTS `public_number_set`;
CREATE TABLE `public_number_set`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `appid` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公众号appid',
  `appsecret` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公众号appsecret',
  `public_number_url` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '通过公众号进行会员注册的链接地址',
  `business_id` int(11) NOT NULL DEFAULT 0 COMMENT '代理id',
  `restaurant_id` int(11) NULL DEFAULT NULL COMMENT '店铺ID',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员公众号信息表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of public_number_set
-- ----------------------------

-- ----------------------------
-- Table structure for qrc_code
-- ----------------------------
DROP TABLE IF EXISTS `qrc_code`;
CREATE TABLE `qrc_code`  (
  `qrc_code_id` int(11) NOT NULL AUTO_INCREMENT,
  `qrc_code` char(16) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '激活码',
  `qrc_code_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '1' COMMENT '激活码状态',
  `qrc_code_timestamp` int(11) NOT NULL DEFAULT 259000,
  `qrc_rest_timestamp` int(11) NOT NULL DEFAULT 259000,
  `business_id` int(11) NULL DEFAULT NULL,
  `restaurant_id` int(11) NOT NULL DEFAULT 0,
  `last_time` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`qrc_code_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 289 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '餐桌二维码激活码' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of qrc_code
-- ----------------------------

-- ----------------------------
-- Table structure for qrc_device
-- ----------------------------
DROP TABLE IF EXISTS `qrc_device`;
CREATE TABLE `qrc_device`  (
  `qrc_device_id` int(11) NOT NULL AUTO_INCREMENT,
  `qrc_device_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '机器码',
  `qrc_device_status` tinyint(4) NOT NULL DEFAULT 1 COMMENT '机器状态',
  `qrc_device_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '机器名称',
  `qrc_code_id` int(11) NOT NULL COMMENT '绑定的注册码',
  `start_time` int(11) NOT NULL,
  `end_time` int(11) NOT NULL,
  PRIMARY KEY (`qrc_device_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '餐桌二维码设备表' ROW_FORMAT = Compact;

-- ----------------------------
