-- ----------------------------
-- Table structure for refund_order
-- ----------------------------
DROP TABLE IF EXISTS `refund_order`;
CREATE TABLE `refund_order`  (
  `refund_id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `member_id` int(20) UNSIGNED NOT NULL DEFAULT 0,
  `store_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `refund_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '退款单号',
  `trade_sn` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '交易单号 pay_order.order_sn',
  `out_trade_no` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '外部单号',
  `total_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款金额',
  `refund_amount` decimal(12, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实际退款金额（分）',
  `refund_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态：0待退款，1已退款',
  `remarks` varchar(120) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `update_at` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  `out_refund_no` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '外部退款单号',
  PRIMARY KEY (`refund_id`) USING BTREE,
  INDEX `idx_member_id`(`member_id`) USING BTREE,
  INDEX `idx_store_id`(`store_id`) USING BTREE,
  INDEX `idx_merchant_id`(`merchant_id`) USING BTREE,
  INDEX `idx_refund_sn`(`refund_sn`) USING BTREE,
  INDEX `idx_trade_sn`(`trade_sn`) USING BTREE,
  INDEX `idx_out_trade_sn`(`out_trade_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '退款单' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of refund_order
