-- ----------------------------
-- Table structure for restaurant
-- ----------------------------
DROP TABLE IF EXISTS `restaurant`;
CREATE TABLE `restaurant`  (
  `restaurant_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '餐厅id',
  `business_id` int(11) NOT NULL COMMENT '代理id',
  `restaurant_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '餐厅名字',
  `telephone` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '电话',
  `user_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '后台登录名称',
  `user_password` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '后台登录密码',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '餐厅地址',
  `logo` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '简介',
  `city1` int(11) NULL DEFAULT NULL COMMENT '省份',
  `city2` int(11) NULL DEFAULT NULL COMMENT '城市',
  `city3` int(11) NULL DEFAULT NULL COMMENT '区域',
  `advertise_time` int(11) NOT NULL DEFAULT 5 COMMENT '广告时间',
  `adv_language` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '请将取餐牌号放置在餐桌上，我们将尽快为您送餐！' COMMENT '广告语',
  `shuping_adv_language` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '竖屏广告语',
  `double_adv_language` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '双屏客显广告语',
  `lat` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '纬度 Latitude',
  `lng` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '经度 Longitude   简写Lng',
  `take_num` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '\'取餐号\'',
  `pay_prompt` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '凭取餐号到取餐区领餐！' COMMENT '取餐号提示语',
  `desk_num` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '餐牌号' COMMENT '餐牌号',
  `forward_prompt` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '请将您的餐牌号放置在桌上！' COMMENT '餐牌号提示语',
  `pay_num` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '支付号' COMMENT '支付号',
  `pay_prompt2` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '未支付，请拿小票到收银台支付' COMMENT '支付号提示语',
  `telephone1` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '外卖电话1',
  `telephone2` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '外卖电话2',
  `subscription` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公众号信息',
  `down_prompt` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '方雅智能自动点餐系统！' COMMENT '广告语',
  `top_logo` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '小票上logo',
  `next_logo` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '小票下logo',
  `template_id` int(11) NULL DEFAULT NULL,
  `scan_code_payment_img` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '/Public/images/default_pay.gif' COMMENT '扫码支付提示图',
  `wx_order_title` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '下单可享受，每满XXX减XXX' COMMENT '微信点餐order页面标题',
  `restaurant_group` int(5) NULL DEFAULT NULL COMMENT '店铺分组ID',
  `take_num_start` int(11) NULL DEFAULT NULL COMMENT '取餐系列号开始',
  `take_num_end` int(11) NULL DEFAULT NULL COMMENT '取餐系列号结束',
  `tplcolor_id` tinyint(4) NULL DEFAULT 5 COMMENT '横屏模板颜色',
  `push_type` tinyint(1) NULL DEFAULT 1 COMMENT '模式选择 1默认模式(无取餐柜，无叫号屏)2标版叫号核销模式（有叫号屏）3标版取餐柜模式（有取餐柜）',
  `app_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '接口参数',
  `secret` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '接口参数',
  PRIMARY KEY (`restaurant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1380 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺详细信息表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of restaurant
-- ----------------------------

-- ----------------------------
-- Table structure for restaurant_bill
-- ----------------------------
DROP TABLE IF EXISTS `restaurant_bill`;
CREATE TABLE `restaurant_bill`  (
  `restaurant_bill_id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_name` smallint(4) NOT NULL DEFAULT 1 COMMENT '是否打印餐厅名称',
  `qrcode` smallint(4) NOT NULL DEFAULT 1 COMMENT '是否打印取餐二维码',
  `address` smallint(4) NOT NULL DEFAULT 1 COMMENT '是否打印餐厅地址',
  `restaurant_phone` smallint(4) NOT NULL DEFAULT 1 COMMENT '是否打印餐厅电话',
  `take_out_phone` smallint(4) NOT NULL DEFAULT 0 COMMENT '是否打印外卖电话',
  `subscription` smallint(4) NOT NULL DEFAULT 0 COMMENT '是否开启公众号点餐',
  `take_num` smallint(4) NOT NULL DEFAULT 0 COMMENT '是否开启餐桌号',
  `desk_num` smallint(4) NOT NULL DEFAULT 1,
  `forward_prompt` smallint(4) NOT NULL DEFAULT 1,
  `pay_prompt` smallint(4) NOT NULL DEFAULT 1,
  `down_prompt` smallint(4) NOT NULL DEFAULT 1,
  `pay_num` smallint(4) NOT NULL DEFAULT 1,
  `pay_prompt2` smallint(4) NOT NULL DEFAULT 1,
  `order_type` smallint(4) NOT NULL DEFAULT 0,
  `restaurant_id` int(11) NOT NULL DEFAULT 0,
  `is_take_logo` tinyint(2) NOT NULL DEFAULT 1 COMMENT '是否打印店铺logo，1为打印，0为否，默认为1',
  `top_logo` tinyint(2) NOT NULL DEFAULT 1 COMMENT '是否打印小票上logo，1打印，0不打印，默认1',
  `next_logo` tinyint(2) NOT NULL DEFAULT 1 COMMENT '是否打印小票下logo，1打印，0不打印，默认1',
  `cancell_num` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否打印取餐柜核销号，1打印，0不打印，默认1',
  `business_id` int(11) NOT NULL COMMENT '代理id',
  PRIMARY KEY (`restaurant_bill_id`) USING BTREE,
  INDEX `billForRestaurant`(`restaurant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 913 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '票据是否打印哪些信息表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of restaurant_bill
