-- ----------------------------
-- Table structure for restaurant_discount
-- ----------------------------
DROP TABLE IF EXISTS `restaurant_discount`;
CREATE TABLE `restaurant_discount`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '消费满多少',
  `discount` decimal(10, 1) NOT NULL DEFAULT 10.0 COMMENT '打多少折',
  `reduce` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '立减多少元',
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '店铺id',
  `business_id` int(11) NULL DEFAULT NULL COMMENT '代理id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

