  `district_name` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '分区名',
  `restaurant_id` int(11) NOT NULL DEFAULT 0,
  `district_mark` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '推送的标识',
  `yell_equipment_id` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`district_id`) USING BTREE
