CREATE TABLE `restaurant_group`  (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '状态 1正常  0删除',
  `group_name` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '分组名',
  `sort` tinyint(4) NULL DEFAULT 99 COMMENT '顺序 1在前面',
  `business_id` int(11) NULL DEFAULT NULL COMMENT '代理id',
  `created_time` timestamp NULL DEFAULT NULL COMMENT '添加时间',
  `creater` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`id`) USING BTREE
