  `manager_phone` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `manager_ps` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `is_main` tinyint(4) NULL DEFAULT NULL COMMENT '是否是超级管理员  null为超级管理员',
  `permission` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所拥有的的权限',
  `role_id` int(11) NOT NULL COMMENT 'role表的id  角色id',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `lg`(`login_account`) USING BTREE,
  INDEX `login_account`(`login_account`) USING BTREE,
  INDEX `login_account_2`(`login_account`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1983 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '店铺账号、密码表' ROW_FORMAT = Compact;

