-- ----------------------------
-- Table structure for restaurant_yazuo
-- ----------------------------
DROP TABLE IF EXISTS `restaurant_yazuo`;
CREATE TABLE `restaurant_yazuo`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `restaurant_id` int(11) NOT NULL COMMENT '店铺ID',
  `is_open` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否开启',
  `username` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商户用户名',
  `password` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商户密码',
  `agree_image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '同意加入会员背景图',
  `member_image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '会员背景图',
  `create_at` int(11) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_at` int(11) NOT NULL COMMENT '更新时间',
  `merchant_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '门店编号',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `restaurant_id`(`restaurant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 84 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '店铺雅座会员表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of restaurant_yazuo
-- ----------------------------

-- ----------------------------
-- Table structure for role
-- ----------------------------
DROP TABLE IF EXISTS `role`;
CREATE TABLE `role`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_name` char(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `role_desc` char(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `parent_id` int(11) NOT NULL DEFAULT 0,
  `action_list` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限列表，存的是action权限表中的id',
  `business_id` int(11) NOT NULL DEFAULT 0,
  `restaurant_id` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 50 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '角色表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of role
-- ----------------------------

-- ----------------------------
-- Table structure for set
-- ----------------------------
DROP TABLE IF EXISTS `set`;
CREATE TABLE `set`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `if_open` smallint(6) NULL DEFAULT NULL COMMENT '是否开启,1开启，0关闭',
  `if_vip` smallint(6) NULL DEFAULT NULL COMMENT '全部还是会员    1全部，0仅会员',
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '店铺id',
  `type` smallint(6) NOT NULL DEFAULT 0 COMMENT '类型  0会员折扣  2积分换取  3积分兑换现金  4积分兑换物品 5店铺折扣 6会员余额',
  `if_openpre` smallint(6) NULL DEFAULT NULL COMMENT '是否开启,1开启，0关闭',
  `business_id` int(11) NULL DEFAULT NULL COMMENT '代理id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 30 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of set
-- ----------------------------

-- ----------------------------
-- Table structure for sms_vip
-- ----------------------------
DROP TABLE IF EXISTS `sms_vip`;
CREATE TABLE `sms_vip`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `appkey` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '阿里短信appkey',
  `secret` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '阿里短信secret',
  `sign` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '阿里短信签名',
  `temp_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '阿里短信模板ID',
  `business_id` int(11) NOT NULL DEFAULT 0 COMMENT '关联代理id',
  `is_new_user` tinyint(1) NOT NULL DEFAULT 1 COMMENT '是否是新用户，0代表老用户，1代表新用户',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员短信配置信息' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of sms_vip
-- ----------------------------

-- ----------------------------
-- Table structure for store
-- ----------------------------
DROP TABLE IF EXISTS `store`;
CREATE TABLE `store`  (
  `store_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '门店ID',
  `merchant_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商户ID',
  `store_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '门店名称',
  `store_addr` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '门店地址',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态：0禁用，1启用',
  `create_at` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_at` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除：0否，1是',
  PRIMARY KEY (`store_id`) USING BTREE,
  INDEX `idx_mch_id`(`merchant_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '门店表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of store
-- ----------------------------

-- ----------------------------
-- Table structure for store_device
-- ----------------------------
DROP TABLE IF EXISTS `store_device`;
CREATE TABLE `store_device`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `app_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `store_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `mac` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `secret` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 21 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of store_device
-- ----------------------------

-- ----------------------------
-- Table structure for system_admin
-- ----------------------------
DROP TABLE IF EXISTS `system_admin`;
CREATE TABLE `system_admin`  (
  `id` smallint(5) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '后台管理员表ID',
  `account` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '后台管理员账号',
  `head_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '后台管理员头像',
  `pwd` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '后台管理员密码',
  `real_name` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '后台管理员姓名',
  `roles` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '后台管理员权限(menus_id)',
  `last_ip` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '后台管理员最后一次登录ip',
  `last_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '后台管理员最后一次登录时间',
  `add_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '后台管理员添加时间',
  `login_count` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登录次数',
  `status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '后台管理员状态 1有效0无效',
  `is_del` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `account`(`account`) USING BTREE,
  INDEX `status`(`status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '后台管理员表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of system_admin
-- ----------------------------

-- ----------------------------
-- Table structure for test
-- ----------------------------
DROP TABLE IF EXISTS `test`;
CREATE TABLE `test`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  `test` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4294967295 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '测试表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of test
-- ----------------------------

-- ----------------------------
-- Table structure for vip
-- ----------------------------
DROP TABLE IF EXISTS `vip`;
CREATE TABLE `vip`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员IC卡',
  `username` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员名字',
  `phone` bigint(11) NOT NULL DEFAULT 0 COMMENT '电话',
  `age` tinyint(4) NOT NULL DEFAULT 0 COMMENT '年龄',
  `birthday` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '生日',
  `sex` smallint(4) NOT NULL DEFAULT 1 COMMENT '性别，男为1，女为0',
  `remainder` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '余额',
  `score` int(11) NOT NULL DEFAULT 0 COMMENT '积分',
  `total_consume` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '消费总计',
  `business_id` int(11) NOT NULL DEFAULT 0 COMMENT '代理id，用来关联哪个代理，便于领折扣优惠',
  `openid` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微信openid',
  `headimgurl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '微信头像',
  `group_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '会员组ID',
  `restaurant_or_business` tinyint(2) NOT NULL DEFAULT 1 COMMENT '关联店铺还是代理，1代理，2店铺，默认1代理',
  `card_num` varchar(5) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '会员卡号',
  `password` char(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '会员卡的支付密码',
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '当会员关联店铺时关联的店铺id',
  `weixin_user` int(11) NOT NULL DEFAULT 0 COMMENT '小程序用户ID',
  `unionid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'unionid 微信唯一标识',
  `xcx_openid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '小程序openid',
  `vip_card` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '会员IC卡',
  `add_time` int(11) NOT NULL DEFAULT 0 COMMENT '添加时间',
  `is_phone` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否绑定手机',
  `aaa` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 79 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of vip
-- ----------------------------

-- ----------------------------
-- Table structure for vip_group
-- ----------------------------
DROP TABLE IF EXISTS `vip_group`;
CREATE TABLE `vip_group`  (
  `group_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `business_id` int(11) NOT NULL DEFAULT 0 COMMENT '代理ID',
  `group_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '会员组名称',
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '店铺id',
  PRIMARY KEY (`group_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of vip_group
-- ----------------------------

-- ----------------------------
-- Table structure for vip_money_log
-- ----------------------------
DROP TABLE IF EXISTS `vip_money_log`;
CREATE TABLE `vip_money_log`  (
  `log_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `vip_id` int(11) NOT NULL DEFAULT 0 COMMENT '会员ID',
  `order_sn` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单编号',
  `remainder` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '变动前会员余额',
  `money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '变动金额',
  `add_time` int(11) NOT NULL COMMENT '添加时间',
  `log_type` int(2) NOT NULL DEFAULT 0 COMMENT '1充值， 2支付',
  PRIMARY KEY (`log_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 11 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员余额变动记录表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of vip_money_log
-- ----------------------------

-- ----------------------------
-- Table structure for vip_third_party
-- ----------------------------
DROP TABLE IF EXISTS `vip_third_party`;
CREATE TABLE `vip_third_party`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `vip_id` bigint(20) UNSIGNED NOT NULL DEFAULT 0 COMMENT '本站用户id',
  `last_login_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '最后登录时间',
  `expire_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'access_token过期时间',
  `create_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '绑定时间',
  `login_times` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登录次数',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT '状态;1:正常;0:禁用',
  `nickname` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户昵称',
  `third_party` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '第三方惟一码',
  `app_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '第三方应用 id',
  `last_login_ip` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '最后登录ip',
  `access_token` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '第三方授权码',
  `openid` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '第三方用户id',
  `union_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '第三方用户多个产品中的惟一 id,(如:微信平台)',
  `more` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '扩展信息',
  `restaurant_id` int(11) NOT NULL DEFAULT 0 COMMENT '当会员关联店铺时关联的店铺id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 9 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '第三方用户表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of vip_third_party
-- ----------------------------

-- ----------------------------
-- Table structure for wechat
-- ----------------------------
DROP TABLE IF EXISTS `wechat`;
CREATE TABLE `wechat`  (
  `wechat_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '表id',
  `appid` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '微信appid',
  `appsecret` varchar(120) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '微信appseret',
  `restaurant_id` int(11) NOT NULL COMMENT '店铺id',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0普通订阅号,1普通服务号,2认证订阅号,3认证服务号企业号',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公众号名',
  `is_set` tinyint(1) NOT NULL DEFAULT 0 COMMENT '用于判断用户是否有设置服务器地址，1已配置，0未配置',
  `describe` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公众号描述',
  `account` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公众号账号',
  `first_id` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公众号原始id',
  `menu_json` varchar(3500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '自定义菜单的json数据',
  PRIMARY KEY (`wechat_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '微信信息配置表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wechat
-- ----------------------------

-- ----------------------------
-- Table structure for wx_config
-- ----------------------------
DROP TABLE IF EXISTS `wx_config`;
CREATE TABLE `wx_config`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `app_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务商支付的绑定支付的APPID',
  `mchid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务商支付的商户号',
  `app_secret` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '服务商支付的appsecret',
  `child_mchid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '子商户号',
  `oy_app_id` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '普通支付的绑定支付的APPID',
  `oy_app_secret` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '普通支付的商户秘钥appsecret',
  `oy_mchid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '普通支付的商户号',
  `oy_key` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '普通支付商户支付密钥',
  `resturant_id` int(11) NOT NULL COMMENT '店铺id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Records of wx_config
